import React from "react";

const Separator = props => {
  return (
    <div
      style={
        props.location
          ? props.location.pathname === "/"
            ? { height: "1px" }
            : { height: "70px" }
          : { height: "1px" }
      }
    >
      {console.log(props)}
    </div>
  );
};

export default Separator;
